  "api_panel_md_curl_example": "\n<!--split-->\n\n## Get records\n\n```shell\ncurl \"{{ apiBase }}/fusion/v1/datasheets/{{ datasheetId }}/records?viewId={{ viewId }}&fieldKey={{ fieldKey }}\" \\\n  -H \"Authorization: Bearer {{ apiToken }}\"\n\n```\n\n### Returned data example\n\n```json\n\n{{ response }}\n\n```\n\n### Other parameters and tips\n```js\n/**\n * æ³¨æ„ï¼šæ¯å¼ ç»´æ ¼è¡¨è·å–æ•°æ®æœ€å¤§å¹¶å‘é‡é™åˆ¶ä¸º 1 ç§’é’Ÿ 5 æ¬¡\n * å…¨éƒ¨å¯é…ç½®çš„å‚æ•°ï¼Œå¯é€šè¿‡ URL Query Params å‘é€ï¼Œ\n */\n{\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰è§†å›¾IDã€‚é»˜è®¤ä¸ºç»´æ ¼è¡¨ä¸­ç¬¬ä¸€ä¸ªè§†å›¾ã€‚è¯·æ±‚ä¼šè¿”å›è§†å›¾ä¸­ç»è¿‡è§†å›¾ä¸­ç­›é€‰/æ’åºåçš„ç»“æœï¼Œå¯ä»¥æ­é…ä½¿ç”¨fieldså‚æ•°è¿‡æ»¤ä¸éœ€è¦çš„å­—æ®µæ•°æ®\n   */\n  viewId: 'viewId1',\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰æŒ‡å®šåˆ†é¡µçš„é¡µç ï¼Œé»˜è®¤ä¸º 1ï¼Œä¸å‚æ•°pageSizeé…åˆä½¿ç”¨ã€‚\n   */\n  pageNum: 1,\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰æŒ‡å®šæ¯é¡µè¿”å›çš„è®°å½•æ€»æ•°ï¼Œé»˜è®¤ä¸º100ã€‚æ­¤å‚æ•°åªæ¥å—1-1000çš„æ•´æ•°ã€‚\n   */\n  pageSize: 100,\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰å¯¹æŒ‡å®šç»´æ ¼è¡¨çš„è®°å½•è¿›è¡Œæ’åºã€‚ç”±å¤šä¸ªâ€œæ’åºå¯¹è±¡â€ç»„æˆçš„æ•°ç»„ã€‚æ”¯æŒé¡ºåºï¼š'asc' å’Œ é€†åºï¼š'desc'ã€‚æ³¨ï¼šæ­¤å‚æ•°æŒ‡å®šçš„æ’åºæ¡ä»¶å°†ä¼šè¦†ç›–è§†å›¾é‡Œçš„æ’åºæ¡ä»¶ã€‚\n   */\n  sort: [{ field: 'field1', order: 'asc' }],\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰recordIds æ•°ç»„ã€‚å¦‚æœé™„å¸¦æ­¤å‚æ•°ï¼Œåˆ™è¿”å›å‚æ•°ä¸­æŒ‡å®šçš„recordsæ•°ç»„ã€‚ è¿”å›å€¼æŒ‰ç…§ä¼ å…¥æ•°ç»„çš„é¡ºåºæ’åºã€‚æ­¤æ—¶æ— è§†ç­›é€‰ã€æ’åºã€‚æ— åˆ†é¡µï¼Œæ¯æ¬¡æœ€å¤šæŸ¥è¯¢ 1000 æ¡\n   */\n  recordIds: ['recordId1', 'recordId2'],\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰æŒ‡å®šè¦è¿”å›çš„å­—æ®µï¼ˆé»˜è®¤ä¸ºå­—æ®µå, ä¹Ÿå¯ä»¥é€šè¿‡ fieldKey æŒ‡å®šä¸ºå­—æ®µ Idï¼‰ã€‚å¦‚æœé™„å¸¦æ­¤å‚æ•°ï¼Œåˆ™è¿”å›çš„è®°å½•åˆé›†å°†ä¼šè¢«è¿‡æ»¤ï¼Œåªæœ‰æŒ‡å®šçš„å­—æ®µä¼šè¿”å›ã€‚\n   */\n  fields: ['æ ‡é¢˜', 'è¯¦æƒ…', 'å¼•ç”¨æ¬¡æ•°'],\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰ä½¿ç”¨å…¬å¼ä½œä¸ºç­›é€‰æ¡ä»¶ï¼Œè¿”å›åŒ¹é…çš„è®°å½•ï¼Œè®¿é—® https://help.vika.cn/docs/guide/tutorial-getting-started-with-formulas äº†è§£å…¬å¼ä½¿ç”¨æ–¹å¼\n   */\n  filterByFormula: '{å¼•ç”¨æ¬¡æ•°} >  0',\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰é™åˆ¶è¿”å›è®°å½•çš„æ€»æ•°é‡ã€‚å¦‚æœè¯¥å€¼å°äºè¡¨ä¸­å®é™…çš„è®°å½•æ€»æ•°ï¼Œåˆ™è¿”å›çš„è®°å½•æ€»æ•°ä¼šè¢«é™åˆ¶ä¸ºè¯¥å€¼ã€‚\n   */\n  maxRecords: 5000,\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰å•å…ƒæ ¼å€¼ç±»å‹ï¼Œé»˜è®¤ä¸º 'json'ï¼ŒæŒ‡å®šä¸º 'string' æ—¶æ‰€æœ‰å€¼éƒ½å°†è¢«è‡ªåŠ¨è½¬æ¢ä¸º string æ ¼å¼ã€‚\n   */\n  cellFormat: 'json',\n  /**\n   * ï¼ˆé€‰å¡«ï¼‰æŒ‡å®š field çš„æŸ¥è¯¢å’Œè¿”å›çš„ keyã€‚é»˜è®¤ä½¿ç”¨åˆ—å  'name' ã€‚æŒ‡å®šä¸º 'id' æ—¶å°†ä»¥ fieldId ä½œä¸ºæŸ¥è¯¢å’Œè¿”å›æ–¹å¼ï¼ˆä½¿ç”¨ id å¯ä»¥é¿å…åˆ—åçš„ä¿®æ”¹å¯¼è‡´ä»£ç å¤±æ•ˆé—®é¢˜ï¼‰\n   */\n  fieldKey: 'name',\n}\n```\n\n<!--split-->\n\n## Add records\n```shell\ncurl -X POST \"{{ apiBase }}/fusion/v1/datasheets/{{ datasheetId }}/records?viewId={{ viewId }}&fieldKey={{ fieldKey }}\"  \\\n  -H \"Authorization: Bearer {{ apiToken }}\" \\\n  -H \"Content-Type: application/json\" \\\n  --data '{\n  \"records\": {{ records }},\n  \"fieldKey\": \"{{ fieldKey }}\"\n}'\n\n```\n\n### Returned data example\n\n```json\n{{ response }}\n```\n\n### Other parameters and tips\n\nadd æ¥å£æ¥æ”¶ä¸€ä¸ªæ•°ç»„å€¼ï¼Œå¯ä»¥åŒæ—¶åˆ›å»ºå¤šæ¡ recordï¼Œå•æ¬¡è¯·æ±‚å¯æœ€å¤šåˆ›å»º10æ¡ record\n\n<!--split-->\n\n## Update records\n```shell\ncurl -X PATCH \"{{ apiBase }}/fusion/v1/datasheets/{{ datasheetId }}/records?viewId={{ viewId }}&fieldKey={{ fieldKey }}\" \\\n  -H \"Authorization: Bearer {{ apiToken }}\" \\\n  -H \"Content-Type: application/json\" \\\n  --data '{\n  \"records\": {{ records }},\n  \"fieldKey\": \"{{ fieldKey }}\"\n}'\n```\n### Returned data example\n\n```json\n{{ response }}\n```\n\n\n### Other parameters and tips\n\nupdate æ¥å£æ¥æ”¶ä¸€ä¸ªæ•°ç»„å€¼ï¼Œå¯ä»¥åŒæ—¶æ›´æ–°å¤šæ¡ recordï¼Œå•æ¬¡è¯·æ±‚å¯æœ€å¤šæ›´æ–°10æ¡ record\nç‰¹åˆ«æ³¨æ„ï¼š update åªä¼šæ›´æ–°ä½ ä¼ å…¥çš„ fields ä¸‹çš„æ•°æ®ï¼Œæœªä¼ å…¥çš„ä¸ä¼šå½±å“ï¼Œå¦‚æœéœ€è¦æ¸…ç©ºå€¼ï¼Œè¯·æ˜¾å¼ä¼ å…¥ null\n\n\n<!--split-->\n\n## Delete records\n```shell\ncurl -X DELETE \"{{ apiBase }}/fusion/v1/datasheets/{{ datasheetId }}/records?{{ deleteParams }}\" \\\n  -H \"Authorization: Bearer {{ apiToken }}\"\n\n```\n\n### Returned data example\n```json\n{\n  \"code\": 200,\n  \"success\": true,\n  \"message\": \"è¯·æ±‚æˆåŠŸ\"\n}\n```\n\n### Other parameters and tips\n\ndelete æ¥å£æ¥æ”¶ä¸€ä¸ªæ•°ç»„å€¼ï¼Œå¯ä»¥åŒæ—¶åˆ é™¤å¤šæ¡ recordï¼Œå•æ¬¡è¯·æ±‚å¯æœ€å¤šåˆ é™¤10æ¡ record\n<!--split-->\n\n## Upload attachments\n\n```shell\ncurl -X POST \"{{ apiBase }}/fusion/v1/datasheets/{{ datasheetId }}/attachments\" \\\n  -H \"Authorization: Bearer {{ apiToken }}\" \\\n  -H \"Content-Type: multipart/form-data\" \\\n  -F \"file=@{ä½ çš„ æ–‡ä»¶è·¯å¾„};\"\n```\n### Returned data example\n\n*Tips:ä¸Šä¼ å®Œæ¯•åï¼Œè¯·å°½å¿«å†™å…¥data ä¸­çš„æ•°æ®åˆ°é™„ä»¶å•å…ƒæ ¼é‡Œï¼Œå¦åˆ™é™„ä»¶é“¾æ¥å¯èƒ½å¤±æ•ˆ*\n\n```json\n{\n  \"code\": 200,\n  \"success\": true,\n  \"message\": \"è¯·æ±‚æˆåŠŸ\",\n  \"data\": {\n    \"id\": \"atcPtxnvqti5M\",\n    \"name\": \"6.gif\",\n    \"size\": 33914,\n    \"mimeType\": \"image/gif\",\n    \"token\": \"space/2020/09/22/01ee7202922d48688f61e34f12da5abc\",\n    \"width\": 240,\n    \"height\": 240,\n    \"url\": \"https://s4.vika.cn/space/2020/09/22/01ee7202922d48688f61e34f12da5abc\"\n  }\n}\n```",
