  "api_panel_md_python_example": "## Initialize SDK [![github]({{ githubIcon }})](https://github.com/vikadata/vika.py)\n\n```python\nfrom vika import Vika\nvika = Vika(\"{{ apiToken }}\")\ndatasheet = vika.datasheet(\"{{ datasheetId }}\", field_key=\"{{ fieldKey }}\")\n```\n\n{{ fieldNameTips }}\n<!--split-->\n\n## Get records\n\n```python\n# Returns all records\nrecords = datasheet.records.all()\nfor record in records:\n  print(record.json())\n\n# Returns the records from a specific view\nrecords_via_view = datasheet.records.all(viewId=\"{{ viewId }}\")\n# Get one record (if there are more than one records in the result, return the first record); It's recommended to get one record by its recordId.\none_record = datasheet.records.get({{ pyGetParams }})\n# Returns the records that matches the given condition. If you don't give any condition, it returns all records.\nrecords = datasheet.records.filter({{ pyGetParams }})\n```\n<!--split-->\n\n## Add records\n```python\n# Add one record\nrow = datasheet.records.create({{ addParams }})\n# Add multiple records\nrecords = datasheet.records.bulk_create({{  bulkAddParams }})\n\n```\n<!--split-->\n\n## Update records\n```python\nrow = datasheet.records.get({{ pyGetParams }})\n\n# Update one record\nrow.{{ oneFieldKey }} = {{ oneFieldValue }}\n## row.save()\n\n# Update multiple records\nrow.update({{ updateParams }})\n\n```\n<!--split-->\n\n## Delete records\n```python\nrecord = datasheet.records.get({{ pyGetParams }})\n# Delete one record\nrecord.delete()\n# Delete the records that matches a specific condition\ndatasheet.records.filter({{ pyGetParams }}).delete()\n# Delete the records by recordIds\ndatasheet.delete_records({{ recordIds }})\n```\n<!--split-->\n\n## Upload attachments\n\n```python\n_file = datasheet.upload_file(<local/web_filepath>)\nrecord.{{ attachFieldName }} = [_file]\n```",
